DROP TABLE IF EXISTS `passport_records`;
CREATE TABLE `passport_records`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `task_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '任务ID',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT 'pending' COMMENT 'pending: 任务等待处理\r\nprocessing: 任务正在处理中\r\ncompleted: 任务成功完成\r\nfailed: 任务处理失败',
